import React from 'react';
import './OrderCompleted.css';
import {Link, useNavigate} from "react-router-dom";
import { Helmet } from 'react-helmet';
import axios from "axios";
import Cookies from "js-cookie";

const OrderCompleted = () => {
    const navigate = useNavigate();

    const getUserRole = async (userId) => {
        try {
            const response = await axios.get(`http://localhost:8000/read_user/${userId}/`);
            return response.data.role;
        } catch (error) {
            console.error("Failed to fetch user role:", error);
            return null;
        }
    };

    const handleUserIconClick = async (e) => {
        e.preventDefault();
        const userId = localStorage.getItem('user_id');
        if (Cookies.get('auth_token') && userId) {
            const role = await getUserRole(userId);
            if (role === 'user') {
                navigate('/profile/personal_information');
            } else if (role === 'admin') {
                navigate('/admin/performance_overview');
            } else {
                navigate('/sign_in');
            }
        } else {
            console.log("Something Wrong !!")
        }
    };


    return (
        <div>
            <Helmet>
                <title>Cart - Order Completed</title>
            </Helmet>

            <nav className="navbar">
                <div className="top">
                    <img src="/images/Home/logo.jpg" alt="Logo"/>
                </div>
                <div className="bottom">
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <Link to="/" className="nav-link">Home</Link>
                        </li>
                        <li className="nav-item">
                            <Link to="/shop" className="nav-link">Shop</Link>
                        </li>
                        <li className="nav-item">
                            <Link to="/aboutus" className="nav-link">About Us</Link>
                        </li>
                        <li className="nav-item">
                            <Link to="/faqs" className="nav-link">FAQs</Link>
                        </li>
                        <li className="nav-item">
                            <Link to="/contact" className="nav-link">Contact</Link>
                        </li>
                    </ul>
                    <ul className="icons">
                        <li>
                            <Link to="/cart">
                                <i className="fas fa-shopping-cart"></i>
                            </Link>
                        </li>
                        <li>
                            <Link to="/wishlist">
                                <i className="fas fa-heart"></i>
                            </Link>
                        </li>
                        <li>
                            <Link to="/profile" onClick={handleUserIconClick}>
                                <i className="fas fa-user"></i>
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>

            <div className="progress-container">
                <div className="step">
                    <div className="step-number">01</div>
                    <div className="step-title">Shopping Cart</div>
                </div>
                <div className="step">
                    <div className="step-number">02</div>
                    <div className="step-title">Check Out</div>
                </div>
                <div className="step active">
                    <div className="step-number">03</div>
                    <div className="step-title">Order Completed</div>
                </div>
            </div>

            <div className="confirm-order-container">
                <h1 className="confirm-order-title">Order Completed Successfully</h1>
                <p className="confirm-order-message">Customer service will contact you to finalize your order.</p>
                <video className="confirm-order-video" autoPlay loop muted playsInline>
                    <source src="/images/Cart/order-completed.mp4" type="video/mp4"/>
                    Your browser does not support the video tag.
                </video>
            </div>


            <div className="footer">
                <div className="footer-content">

                    <div className="footer-logo">
                        <img src="/images/Home/logo.jpg" alt="Logo"/>
                    </div>

                    <div className="footer-info">
                        <h2>Information</h2>
                        <ul>
                            <li>Delivery Information</li>
                            <li>FAQs</li>
                            <li>Contact</li>
                        </ul>
                    </div>

                    <div className="footer-contact">
                        <h2>Get In Touch</h2>
                        <p>We'd love to hear from you.</p>
                        <ul className="icons">
                            <li>
                                <Link to="/">
                                    <i className="fab fa-instagram"></i>
                                </Link>
                            </li>
                            <li>
                                <Link to="/">
                                    <i className="fab fa-whatsapp"></i>
                                </Link>
                            </li>
                            <li>
                                <Link to="/">
                                    <i className="fab fa-facebook"></i>
                                </Link>
                            </li>
                        </ul>

                    </div>

                </div>

                <hr></hr>

                <div className="footer-copyright">
                    <p>Copyright © 2024. All Rights Reserved.</p>
                </div>

            </div>


        </div>

    );
};

export default OrderCompleted;
